import './App.css';
import { Nav } from './Components/Nav';
import {Home} from './Pages/Home'
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router forceRefresh={true}>
         <Nav />
         <Switch>
            <Route forceRefresh={true} exact path="/">
               <Home />
            </Route>
         </Switch>
      </Router>
  );
}

export default App;
